				userLogin=userSelectd.getLogin();
			}

		if (ufrDTO!= null && saveOrderMap!= null && saveOrderMap!= -1){	
			ufrDTO = prepareUserFileRecovery(ufrDTO , selectedFileType, userId);
			if(ufrDTO != null){
				boolean result = orderService.insertUserFileRecoveryRecord(ufrDTO);
				if(result==true){
						System.out.println("One row inserted Succesfully");
				}
				System.out.println("you have selected :  "+ ufrDTO.getProductOrderNumber());
				System.out.println("you have selected :  "+ ufrDTO.getFormatDate());
			}
		}

	} catch (Exception e) {
		e.printStackTrace();
		return "input";
	}
		return SUCCESS;
	}

	/*=========================  createUserLogo ===========================
	 				Create  Blank User Logo if not Exist
	  =================================================================*/
	public void createUserLogo(String source, String destination) throws IOException{
		File fileLogo=new File(destination);
		if(!fileLogo.exists()){
			InputStream in = new FileInputStream(source);
			OutputStream out = new FileOutputStream(destination);
			byte[] buf = new byte[1024];
			int len;
			while ((len = in.read(buf)) > 0) {
				out.write(buf, 0, len);
			}
			in.close();
			out.close();	
		}
	}	

